// Function to calculate stay duration
function calculateStayDuration() {
    var startDate = new Date(document.getElementById('start-date').value);
    var endDate = new Date(document.getElementById('end-date').value);
    
    // Calculate the difference in milliseconds
    var difference = endDate.getTime() - startDate.getTime();
    
    // Convert milliseconds to days
    var days = difference / (1000  3600  24);
    
    // Display the duration in the "duration" input field
    document.getElementById('duration').value = days + ' days';
}

// Add event listeners to date inputs
document.getElementById('start-date').addEventListener('change', calculateStayDuration);
document.getElementById('end-date').addEventListener('change', calculateStayDuration);

// Calculate stay duration on page load (if dates are pre-filled)
